import React from 'react';
import image from "../assets/pizzaLeft.jpg";

function Contact() {
  return (
    <div className='contact'>
        <div className="leftSide" style={{ backgroundImage: `url(${image})` }}></div>
        <div className="rightSide">
            <h1>Contact Us</h1>

            
        </div>
    </div>
  )
}

export default Contact
